CREATE TABLE [ORGAO] ( 
COD_ORGAO INT, 
NOME_ORGAO VARCHAR(45), 
QTD_ORGAOS_SUBORDINADOS INT, 
PRIMARY KEY (COD_ORGAO) 
); 


CREATE TABLE [FUNCAO] ( 
COD_FUNCAO INT, 
NOME_FUNCAO VARCHAR(21), 
PRIMARY KEY (COD_FUNCAO) 
); 


CREATE TABLE [SUBFUNCAO] ( 
COD_SUBFUNCAO INT, 
NOME_SUBFUNCAO VARCHAR(48), 
PRIMARY KEY (COD_SUBFUNCAO) 
); 


CREATE TABLE [DETALHAMENTO_FUNCAO] ( 
COD_DETALHAMENTO INT, 
COD_FUNCAO INT, 
COD_SUBFUNCAO INT, 
FOREIGN KEY (COD_FUNCAO) REFERENCES FUNCAO(COD_FUNCAO), 
FOREIGN KEY (COD_SUBFUNCAO) REFERENCES SUBFUNCAO(COD_SUBFUNCAO), 
PRIMARY KEY (COD_DETALHAMENTO, COD_FUNCAO, COD_SUBFUNCAO) 
); 


CREATE TABLE [PROGRAMA_GOVERNO] ( 
COD_PROGRAMA_GOVERNO INT, 
NOME_PROGRAMA_GOVERNO VARCHAR(76), 
PRIMARY KEY (COD_PROGRAMA_GOVERNO) 
); 


CREATE TABLE [DESPESA_PUBLICA] ( 
COD_DESPESA INT, 
COD_ORGAO INT, 
COD_PROGRAMA_GOVERNO INT, 
COD_DETALHAMENTO INT, 
ANO_DESPESA INT, 
MES_DESPESA INT, 
MODALIDADE_DESPESA VARCHAR(58), 
VALOR_DESPESA DECIMAL(10,5), 
FOREIGN KEY (COD_ORGAO) REFERENCES ORGAO(COD_ORGAO), 
FOREIGN KEY (COD_PROGRAMA_GOVERNO) REFERENCES PROGRAMA_GOVERNO(COD_PROGRAMA_GOVERNO), 
FOREIGN KEY (COD_DETALHAMENTO) REFERENCES DETALHAMENTO_FUNCAO(COD_DETALHAMENTO), 
PRIMARY KEY (COD_DESPESA, COD_ORGAO, COD_PROGRAMA_GOVERNO, COD_DETALHAMENTO) 
); 


